import React,{useState} from 'react'
import styled from 'styled-components'
import MenuIcon from '@material-ui/icons/Menu';
import CloseIcon from '@material-ui/icons/Close';
import { selectCar, selectCars } from "../features/car/CarSlice";
import { useSelector } from "react-redux";


function Header() {

    const [burgerStatus, setBurgerStatus] = useState(false);

    const cars = useSelector(selectCars)
    console.log(cars);

    return (
        <Container>
            <a>
                <img  src="/images/logo.svg" alt="" />
            </a>

            <Menu>

{cars && cars.map((car, index) =>(
    <a key={index} href="#" >{car}</a>
) )}



{/* <p><a href="#">model S</a></p>
<p><a href="#">model 3</a></p>
<p><a href="#">model X</a></p>
<p><a href="#">model Y</a></p>
<p><a href="#">Solar roof</a></p>
<p><a href="#">solar panels</a></p> */}


            </Menu>
<RightMenu>
    <a href="#" >shop</a>
    <a href="#" >Tesla Account</a>
    <CustomMenu onClick={() => setBurgerStatus(true)} />

</RightMenu>

<BurgerNav show={burgerStatus}>
<CloseWrapper>
<CustomClose onClick={() => setBurgerStatus(false)} />
</CloseWrapper>


{cars && cars.map((car, index) =>(
    <li key={index}><a href="#" >{car}</a></li>
) )}


{/* <li><a href="#">class s</a></li>
<li><a href="#">class 3</a></li>
<li><a href="#">class y</a></li>
<li><a href="#">class x</a></li> */}
<li><a href="#">Existing Inventory</a></li>
<li><a href="#">Used Inventory</a></li>
<li><a href="#">Trade-in</a></li>
<li><a href="#">Cybertruck</a></li>
<li><a href="#">Roadaster</a></li>



</BurgerNav>


        </Container>
    )
}

export default Header


const Container = styled.div `
min-height:60px;
position:fixed;
display:flex;
align-items:center;
padding:0 20px;
Top:0;
Left:0;
Right:0;
z-index: 1;

`


const Menu = styled.div `
display: flex;
align-items:center;
justify-content:center;
flex:1;

a{
     font-family: 'Gotham Medium',-apple-system,BlinkMacSystemFont,"Segoe UI",Roboto,"Helvetica Neue",Arial,sans-serif; 
    font-weight:bold;
    font-size:14px;
    color:#000;
    text-transform:uppercase;
    padding:0 10px;
    flex-Wrap:normal;

}


`
const RightMenu = styled.div `
display:flex;
align-items:center;
a{
    font-family: 'Gotham Medium',-apple-system,BlinkMacSystemFont,"Segoe UI",Roboto,"Helvetica Neue",Arial,sans-serif; 
    font-weight:600;
    font-size:14px;
    color:#000;
    text-transform:uppercase;
    padding:0 10px;
    flex-Wrap:normal;
    margin-right:10px;

}

`
const CustomMenu = styled(MenuIcon) `
cursor:pointer;

`


const BurgerNav = styled.div `
position:fixed;
top:0;
bottom:0;
right:0;
background:white;
width:300px;
z-index:16;
list-style:none;
padding:20px;
display:flex;
flex-direction:column;
text-align:start;
transform: ${props => props.show ? 'translateX(0)' :'translateX(100%)' };
transition: transform 0.2s ease-in;
li {
    padding:15px 0;
    border-bottom:1px solid rgba(0, 0, .2);

    a{
        font-weight:600;
    }
}

`
const CustomClose = styled (CloseIcon) `
cursor:pointer;

`

const CloseWrapper = styled.div `
display:flex;
justify-content:flex-end;
`
